import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css";

const Square = ({ value, onClick }) => {
  return (
    <button className="square" onClick={onClick}>
      {value}
    </button>
  );
};

const Game = () => {
  return (
    <div>
      <h1>Tic Tac Toe</h1>
      <Square />
    </div>
  );
};

ReactDOM.render(<Game />, document.getElementById("root"));
